// core components/views
/*import Dashboard from "views/Dashboard.jsx";*/
//import Icons from "views/Icons.jsx";
import Transfer from "views/Dashboard/Sections/Transfer.jsx";
import Notifications from "views/Dashboard/Sections/Notifications.jsx";
//import Rtl from "views/Rtl.jsx";
//import TableList from "views/TableList.jsx";
import Typography from "views/Typography.jsx";
//import UserProfile from "views/UserProfile.jsx";

const dashboardRoutesUser = [/*
  {
    path: "/dash/dashboard",
    name: "Dashboard",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-chart-pie-36",
    component: Dashboard,
    layout: "/admin"
  },
  {
    path: "/icons",
    name: "Icons",
    rtlName: "الرموز",
    icon: "tim-icons icon-atom",
    component: Icons,
    layout: "/admin"
  },/**/
    {
        path: "/user/transfer",
        name: "Virement",
        rtlName: "تحويل",
        icon: "tim-icons icon-refresh-02",
        component: Transfer,
        /*layout: "/admin"*/
    },
  {
    path: "/user/notifications",
    name: "Notifications",
    rtlName: "إخطارات",
    icon: "tim-icons icon-bell-55",
    component: Notifications,
    /*layout: "/admin"*/
  }/*,
  {
    path: "/user-profile",
    name: "User Profile",
    rtlName: "ملف تعريفي للمستخدم",
    icon: "tim-icons icon-single-02",
    component: UserProfile,
    layout: "/admin"
  }/*,
  {
    path: "/tables",
    name: "Table List",
    rtlName: "قائمة الجدول",
    icon: "tim-icons icon-puzzle-10",
    component: TableList,
    layout: "/admin"
  }*,
  {
    path: "/typography",
    name: "Typography",
    rtlName: "طباعة",
    icon: "tim-icons icon-align-center",
    component: Typography,
    layout: "/admin"
  }/*,
  {
    path: "/rtl-support",
    name: "RTL Support",
    rtlName: "ار تي ال",
    icon: "tim-icons icon-world",
    component: Rtl,
    layout: "/rtl"
  }*/,
  { redirect: true, path: "/", to: "/", navbarName: "Redirect" }
];

export default dashboardRoutesUser;
